  private int computeTrailingWhitespaceLength(CharSequence text) {
      int length = 0;
      for (int i = text.length() - 1; i >= 0; i--) {
          char c = text.charAt(i);
          if (Character.isWhitespace(c)) {
              length++;
          } else {
              break;
          }
      }
      return length;
  }


